import React, { useState } from 'react';
import { Card, Row, Col, Button, Badge, Form, InputGroup } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const [searchTerm, setSearchTerm] = useState('');

  // Demo experiment data
  const demoExperiments = [
    {
      id: 1,
      title: 'Chemical Reaction Experiment',
      objective: 'To observe the reaction between sodium bicarbonate and acetic acid',
      status: 'COMPLETED',
      createdAt: '2024-01-15T10:30:00Z',
      userFullName: 'Demo User'
    },
    {
      id: 2,
      title: 'Plant Growth Study',
      objective: 'To study the effect of different light conditions on plant growth',
      status: 'IN_PROGRESS',
      createdAt: '2024-01-20T14:15:00Z',
      userFullName: 'Demo User'
    },
    {
      id: 3,
      title: 'Microscope Analysis',
      objective: 'To examine various cell structures under different magnifications',
      status: 'DRAFT',
      createdAt: '2024-01-25T09:45:00Z',
      userFullName: 'Demo User'
    }
  ];

  const getStatusBadge = (status) => {
    const variants = {
      DRAFT: 'secondary',
      IN_PROGRESS: 'warning',
      COMPLETED: 'success',
      SUBMITTED: 'info',
      APPROVED: 'success',
      REJECTED: 'danger'
    };
    return <Badge bg={variants[status] || 'secondary'}>{status}</Badge>;
  };

  const filteredExperiments = demoExperiments.filter(exp =>
    exp.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
    exp.objective?.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div>
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2>üß™ My Experiments</h2>
        <Button as={Link} to="/experiment/new" variant="primary">
          + New Experiment
        </Button>
      </div>

      <InputGroup className="mb-4">
        <Form.Control
          placeholder="Search experiments..."
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <Button variant="outline-secondary">
          üîç Search
        </Button>
      </InputGroup>

      {filteredExperiments.length === 0 ? (
        <Card className="text-center p-5">
          <Card.Body>
            <h4>No experiments found</h4>
            <p className="text-muted">
              {searchTerm ? 'Try adjusting your search terms.' : 'Start by creating your first experiment!'}
            </p>
            {!searchTerm && (
              <Button as={Link} to="/experiment/new" variant="primary">
                Create First Experiment
              </Button>
            )}
          </Card.Body>
        </Card>
      ) : (
        <Row>
          {filteredExperiments.map((experiment) => (
            <Col key={experiment.id} lg={4} md={6} className="mb-4">
              <Card className="h-100">
                <Card.Body>
                  <div className="d-flex justify-content-between align-items-start mb-2">
                    <h5 className="card-title">{experiment.title}</h5>
                    {getStatusBadge(experiment.status)}
                  </div>
                  <p className="card-text text-muted">
                    {experiment.objective?.substring(0, 100)}
                    {experiment.objective?.length > 100 && '...'}
                  </p>
                  <div className="d-flex justify-content-between align-items-center">
                    <small className="text-muted">
                      {new Date(experiment.createdAt).toLocaleDateString()}
                    </small>
                    <Button
                      as={Link}
                      to={`/experiment/${experiment.id}`}
                      variant="outline-primary"
                      size="sm"
                    >
                      View Details
                    </Button>
                  </div>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      )}
    </div>
  );
};

export default Dashboard;
